import requests

class DataProcessor:
    def __init__(self, urls):
        self.urls = urls
        self.processed_data = []

    def fetch_data(self, url):
        response = requests.get(url)
        return response.json()

    def process_data(self, data_list):
        self.processed_data = list(set(data_list))

    def run(self):
        all_data = [item for sublist in [self.fetch_data(url) for url in self.urls] for item in sublist]
        self.process_data(all_data)
        return self.processed_data

url1 = "https://api.example.com/data1"
url2 = "https://api.example.com/data2"

processor = DataProcessor([url1, url2])
print(processor.run())
